import * as userTypes from '../constansts/user';

const initialState = {};

const myReduces = (state = initialState, action)=>{
    switch(action.type){
        case userTypes.LOGIN: {
            return {
                ...state,

            };
        }
        case userTypes.HIDE_LOADING: {
            return {
                ...state,
            };
        }
        default: 
            return state;
    };
};

export default myReduces;
